import { useEffect, useState } from "react";
import { useFetch } from "./counter/hooks/use-fetch.js";

const ENDPOINTS = {
  BASE: `https://random-data-api.com/api/v2`,
  get BLOOD_TYPES() {
    return `${this.BASE}/blood_types`;
  },
};

export function BloodTypes() {
  const { data, error, loading, refetch } = useFetch(ENDPOINTS.BLOOD_TYPES);

  if (loading) {
    return `Caricamento in corso...`;
  }

  if (error) {
    return `Errore di caricamento`;
  }

  return (
    <section>
      {JSON.stringify(data)}
      <button className="btn" onClick={refetch}>
        Refresh!
      </button>{" "}
    </section>
  );
}
